from object_detector import run_detection, as_json_format

traffic = ''

import tensorflow as tf

model = tf.saved_model.load('saved_model')

binary = base64.b64decode(traffic)
frame = Image.open(BytesIO(binary))
(img_width, img_height) = frame.size
frame = np.array(frame.getdata()).reshape((img_height, img_width, 3)).astype(np.uint8)
frame = cv2.cvtColor(frame, cv2.COLOR_BGR2RGB)
frame = cv2.resize(frame, (480, 640))
frame = np.expand_dims(frame, 0)

